import React from "react";

const MyInternships=()=>{
    return(
        <>
             <div className="profile-card profile-container">
                <h4><b>My Internships</b></h4>
                <a href="/profile/myinternships" className="see-btn">See more...</a>
            </div>
        </>
    );
};

export default MyInternships;
